* {
  box-sizing: border-box;
}

html,
body {
  margin: 0;
  font-size: 100%;
  background: #fff;
  font-family: "Work Sans", sans-serif;
}

h1,
h2,
h3,
h4,
h5,
h6 {
  margin: 0;
  font-family: "Work Sans", sans-serif;
}

p {
  margin: 0;
  letter-spacing: 1px;
  font-size: 0.9em;
}

a {
  text-decoration: none;
}

/*--navbar--*/

header {
  display: flex;
  width: 100%;
  padding-top: 10px;
  background-color: #405777;
}

.logo {
  padding-left: 25px;
  padding-top: 5px;
  color: #fff;
  width: 100%;
}

.main-nav {
  width: 100%;
  margin-top: 5px;
  overflow: hidden;
  justify-content: end;
  place-content: right;
  padding-right: 25px;
}

.main-nav li {
  padding: 10px 15px;
  text-transform: uppercase;
  text-align: center;
  display: block;
  float: right;
}

.main-nav a {
  color: #fff;
  font-size: 0.99em;
}

.main-nav a:hover {
  color: #a0adbd;
}

/*-- header --*/

#teamPhoto {
  background-image: url("/9512b245465153cd3db1aaeeadddeb7c.jpg");
  width: 100vw;
  height: 100vh;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  box-shadow: inset 0 0 0 2000px rgba(198, 239, 211, 0.3);
  position: relative;
}

#headerTitle {
  text-align: center;
  padding-top: 500px;
  font-size: 50px;
}

#schoolDescription {
  text-align: center;
  padding-top: 10px;
  font-size: 20px;
}

/*-- aboutTheTeam --*/
.aboutTheTeam {
  background-color: #a0adbd;
}

.aboutTheTeam h1 {
  text-align: center;
  padding-top: 30px;
  color: #fff;
  text-transform: uppercase;
}

.container {
  display: flex;
  align-items: center;
  justify-content: center;
}

.teamImage {
  border: 15px solid #405777;
  border-radius: 4px;
  display: flex;
  max-width: 500px;
}

.image {
  flex-basis: 40%;
  padding-left: 200px;
  padding-top: 50px;
  padding-bottom: 50px;
}

.aboutUsText {
  font-size: 20px;
  padding-left: 80px;
  padding-right: 80px;
}

.readMore {
  background-color: #405777;
  border: none;
  color: white;
  padding: 10px 24px;
  text-align: center;
  text-decoration: none;
  display: inline-block;
  font-size: 16px;
}

.readMore:hover {
  background-color: #4f6b92;
}

.readMoreButton {
  padding-top: 15px;
  display: flex;
  padding-left: 40%;
}

/*-- services --*/
* {
  box-sizing: border-box;
}

.servicesTitle {
  text-align: center;
  padding-top: 30px;
  color: #fff;
  text-transform: uppercase;
  background-color: #a0adbd;
  padding-bottom: 30px;
}

.servicesContainer {
  width: 25%;
  float: left;
  padding: 0 10px;
}

.services {
  background-color: #a0adbd;
  display: flex;
  justify-content: center;
  padding-bottom: 50px;
  flex-wrap: wrap;
}

.content {
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  padding: 16px;
  text-align: center;
  background-color: #405777;
  color: #fff;
  border-radius: 5px;
}

.readMoreServices button {
  background-color: #405777;
  border: none;
  color: white;
  padding: 10px 24px;
  text-align: center;
  text-decoration: none;
  font-size: 16px;
}

.readMoreServices button:hover {
  background-color: #4f6b92;
}

.readMoreServices {
  background-color: #a0adbd;
  padding-bottom: 50px;
  display: flex;
  justify-content: center;
}

/*-- gallery --*/
.gallerySection {
  background-color: #a0adbd;
}

.galleryTitle {
  text-align: center;
  padding-top: 30px;
  color: #fff;
  text-transform: uppercase;
  background-color: #a0adbd;
  padding-bottom: 30px;
}

#gallery {
  background-color: #a0adbd;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  grid-gap: 20px;
  align-items: stretch;
  justify-items: center;
  margin: 40px;
}

#gallery img {
  max-width: 100%;
  vertical-align: middle;
  object-fit: cover;
  box-shadow: 2px 2px 6px 0px rgba(0, 0, 0, 0.3);
}
/*-- footer --*/
.footer {
  text-align: center;
  background-color: #405777;
  color: #fff;
  padding-top: 20px;
  padding-bottom: 20px;
}

.footer p {
  padding: 10px 10px;
}

.signUp form {
  padding: 10px 10px;
}

.footer a {
  color: #fff;
}

.footer a:hover {
  color: #a0adbd;
}

.footer ul {
  list-style-type: none;
  margin: 0;
  padding: 0;
  padding-bottom: 10px;
}

.submitButton {
  background-color: #a0adbd;
  border: none;
  color: white;
  padding: 10px 24px;
  text-align: center;
  text-decoration: none;
  display: inline-block;
  font-size: 16px;
}

.submitButton:hover {
  background-color: #4f6b92;
}

.emailInput {
  background-color: #fff;
  border: none;
  color: white;
  padding: 10px 24px;
  text-align: center;
  text-decoration: none;
  display: inline-block;
  font-size: 16px;
}

